import WelcomeScreen from './Welcome';
import LoginScreen from './Login';

export default  [
  {
    name: 'Welcome',
    component: WelcomeScreen,
    options: { headerShown: false },
  },
  {
    name: 'Login',
    component: LoginScreen,
    options: { headerShown: false },
  },
];
